import { makeAutoObservable } from "mobx";

class ActionStore {
    data = []

    constructor() {
        makeAutoObservable(this)
    }

    getAssestsData () {
        fetch('https://www.cryptingup.com/api/assets').then(resp => {
            console.log(resp)
        })
    }

}

export default ActionStore;
